import Gourp12Img1 from '../assets/img/Gourp12/gourp12_img1.png'
import Gourp12Img2 from '../assets/img/Gourp12/gourp12_img2.png'
import Gourp12Img3 from '../assets/img/Gourp12/gourp12_img3.png'
import Gourp12Img4 from '../assets/img/Gourp12/gourp12_im4.png'
import Gourp12Img5 from '../assets/img/Gourp12/gourp12_img5.png'
import Gourp12Img6 from '../assets/img/Gourp12/gourp12_img6.png'

const Gourp12Api = [
    {
            GourpTitle12: [
                {
                    id: 0,
                    title: 'фото-отчет'
                },
                {
                    id: 1,
                    text: 'Делимся впечатлениями'
                }
            ],
            GourpImg: [
                {
                    id: 0,
                    img: Gourp12Img1, 
                },
                {
                    id: 1,
                    img: Gourp12Img2,
                },
                {
                    id: 2,
                    img: Gourp12Img3,
                },
                {
                    id: 3,
                    img: Gourp12Img4,
                },
                {
                    id: 4,
                    img: Gourp12Img5,
                },
                {
                    id: 5,
                    img: Gourp12Img6,
                }
            ],
            GourpButtonText: [
                {
                    buttonText: 'Наш pinterest'
                }
            ]
    }
]
export default Gourp12Api
